04 06:38:16','[Recoeve]','Introducing what we are making : Recoeve.net','Recoeve in one setence : Self-customizing + Multi-Categorized Records for Everything, and Personalized Recommendation for Everything at each Category.\n\nRecord everything that you are interested in and wanna value in a multi-categorized manner. Then get connected to the people of your kind based on your evaluations, and get personalized recommendations for everything from them.\n\nBe free from abusing or contamination, and agenda setting from mass-media which is inevitably to be done by a few editors. Even if they are good at all, some of them might be not of your interest and not be ordered by your importance. Make your important sorts be important. And meet the minority reports of your kinds.\n\nThings that worth spreading, but so specialized especially to a few experts, will be propagated through your neighbors of that particular fields/categories in Recoeve. (You do not have to send messages to them. Just reco it, then the recos will spread out, finding automatically which users might be interested in this.)\n\nWe will also provide a blogging service with docuK and SEE (Super Easy Edit : like LaTeX/Wiki/MarkUp edit, but more flexible and easier than them.). This will be highly connected to recoeve service.','Currently in alpha test service stage.','4.0/5',0,0,0),(100000000,'http://kipid.tistory.com/entry/KARA-HARA-On-and-Off-at-MBC-Music','2015-12-22 15:59:04','2015-12-22 19:23:11','[Music/Break]--KARA--HARA--On and Off','kipid\'s blog :: Íµ¨ÌïòÎùºÏùò On and Off at MBC Music','','','10.0/10',0,0,0),(100000000,'http://kipid.tistory.com/entry/Lists','2015-05-02 21:50:26','2016-11-15 11:29:26','[My Blog]','kipid\'s blog :: Lists','','Ï†ú Î∏îÎ°úÍ∑∏ ÏûÖÎãàÎã§.\nÎ∏îÎ°úÍ∑∏ Í∏ÄÎì§ÏùÄ docuK Ïóê Reco widget Îã¨ÏïÑÏÑú Í∑∏Í±∞ Ïù¥Ïö©Ìï¥ÏÑú reco Ìï† ÏòàÏ†ï.','4.5/5',0,0,0),(100000000,'http://kipid.tistory.com/entry/Machine-Learning','2017-07-03 10:35:56','2017-09-14 01:55:31','[IT/Programming]--Í∏∞Í≥ÑÌï