Îç∞...„Öã.\n\nÏó¨Í∏∞Ï†ÄÍ∏∞ÏÑú Í≤ÄÏ¶ùÏùÑ Î∞õÏïÑÏïº Í≤†ÏßÄÎßå, Î∂àÏôÑÏ†ÑÏÑ± Ï†ïÎ¶¨Îûë Î¨ºÎ¶¨Ìïô Ïù¥Î°†Ïù¥Îûë Í∑∏Îü¥ÎìØÌïòÍ≤å(?) ÏÑûÏñ¥ÏÑú Î¨¥Ïñ∏Í∞Ä Í≤∞Î°†ÏùÑ ÎÉàÎã§ÎäîÍ±∞Î∂ÄÌÑ∞Í∞Ä Ïã†ÏÑ†Ìïú Ï∂©Í≤©Ïù¥... (Í∞úÏù∏Ï†ÅÏúºÎ°† Î∂àÏôÑÏ†ÑÏÑ± Ï†ïÎ¶¨Î•º Î¨ºÎ¶¨Ïù¥Î°†Ïóê Ï†ÅÏö©ÌïòÎ©¥ \"Ïö∞Ï£º ÎÇ¥Î∂ÄÏóê Ï°¥Ïû¨ÌïòÎäî ÏßÄÏ†ÅÏÉùÎ™ÖÏ≤¥Îäî Ïö∞Ï£ºÏùò Î≤ïÏπôÏùÑ ÏôÑÎ≤ΩÌûà Ïù¥Ìï¥ÌïòÍ±∞ÎÇò Î∞ùÌòÄÎÇº Ïàò ÏóÜÏùÑÏàòÎèÑ ÏûàÎäîÍ±∞ ÏïÑÎÉê?\" ÏöîÏ†ïÎèÑÏùò ÏÉùÍ∞ÅÏùÄ ÌñàÏóàÏóàÎäîÎç∞„Öã)\n\nÍ∑∏Îü∞Îç∞ ÏùΩÏñ¥Î≥¥Îãà Î≥ÑÍ±∞ ÏïÑÎãåÍ±∞ Í∞ôÍ∏∞ÎèÑ ÌïòÍ≥†... Î¨¥ÌïúÎåÄÎ°ú Í∞ÄÎ©¥ ÎåÄÎ∂ÄÎ∂Ñ Î™ªÌë∏ÎäîÍ≤ÉÎì§Ïù¥ ÏûàÎäîÍ±∞ ÏïÑÎãåÍ∞Ä? =„Öá=;; Ï†êÍ∑ºÏÑ†Ï°∞Ï∞® Î™ªÏïåÏïÑÎÇ∏Îã§Îäî ÎúªÏù∏Í±¥Í∞Ä? Ïñ¥Î†µÎãπ.','9.0/10',0,0,0),(100000000,'http://www.nature.com/nphys/journal/vaop/ncurrent/pdf/nphys3535.pdf','2015-11-21 14:49:35','2015-11-21 14:49:35','[Physics/Math/Science]--Physics--Experiment about Magnetics','Soliton-like magnetic domain wall motion induced by the interfacial Dzyaloshinskii‚ÄìMoriya interaction','Soliton-like magnetic domain wall motion induced by the interfacial Dzyaloshinskii‚ÄìMoriya interaction\n\nYoko Yoshimura,	Kab-Jin Kim,	Takuya Taniguchi,	Takayuki Tono,	Kohei Ueda,	Ryo Hiramatsu,	Takahiro Moriyama,	Keisuke Yamada,	Yoshinobu Nakatani	& Teruo Ono\n\nTopological defects such as magnetic solitons, vortices and skyrmions have started to play an important role in modern magnetism because of their extraordinary stability1, which can be exploited in the production of memory devices. Recently, a type of antisymmetric exchange interaction, namely the Dzyaloshinskii‚ÄìMoriya interaction (DMI; refs 2,3), has been uncovered and found to influence the formation of topological defects4, 5, 6, 7. Exploring how the DMI affects the dynamics of topological defects is therefore an important task. Here we investigate the dynamics of the magnetic domain wall (DW) under a DMI by developing a real time DW detection scheme. For a weak DMI, the DW velocity increases with the external field and reaches a peak velocity at a threshold field, beyond which it abruptly decreases. For a strong DMI, on the other hand, the velocity reduction is completely suppressed and the peak velocity is maintained constant even far above the threshold field. Such a distinct trend of the velocity can be explained in terms of a magnetic soliton, the topology of which is protected during its motion. Our results therefore shed light on the physics of dynamic topological defects, which paves the way for future work in topology-based memory applications.','',NULL,0,0,0),(100000000,'http://www.naturenscience.co.kr/','2015-05-09 06:33:26','2016-06-01 08:11:27','[Physics/Math/Science]--Open Course Ware','Nature n Science .co.kr','','',NULL,0,0,0),(100000000,'http://www.nytimes.com/2015/05/10/nyregion/manicurists-in-new-york-area-are-underpaid-and-unprotected.html?_r=0','2015-05-09 02:23:12','2015-05-09 02:23:12','[Ï†ïÏπò/ÏÇ¨Ìöå/Í≤ΩÏ†ú]--ÏÇ¨Ìöå','NY Times - The Price of Nice Nails','','','3.1/5',0,0,0),(100000000,'http://www.nytimes.com/2016/03/14/universal/ko/seouls-colonial-boomerang-korean.html?_r=0','2016-03-15 11:23:51','2016-03-15 11:29:47','[Ï†ïÏπò/ÏÇ¨Ìöå/Í≤ΩÏ†ú]--Ïó≠ÏÇ¨--ÎåÄÌïúÎØºÍµ≠','Ïò§ÌîºÎãàÏñ∏: Î∂ÄÎ©îÎûëÏù¥ ÎêòÏñ¥ ÎèåÏïÑÏò§Îäî ÌïúÍµ≠Ïùò Î∞òÏùº Í∞êÏ†ï','','50ÎÖÑ Í∞ÄÍπåÏù¥Î•º ÏãùÎØºÏßÄÎ∞∞ ÎãπÌñàÏúºÎãà...','7.4/10',0,0,0),(100000000,'http://www.oricon.co.jp/prof/503091/products/1123829/1/','2015-05-05 13:42:53','2015-07-01 10:01:19','[Music/Break]--KARA--Links','ORICON - „Çµ„Éû„Éº‚òÜ„Ç∏„ÉÉ„ÇØ/Sunshine Miracle/SUNNY DAYS(ÂàùÂõûÈôêÂÆöÁõ§A)','#Áô∫Â£≤Êó• 2015Âπ¥05Êúà05Êó•	\n#Áô∫Â£≤ÂÖÉ „É¶„Éã„Éê„Éº„Çµ„É´ „Éü„É•„Éº„Ç∏„ÉÉ„ÇØ\n#ÂìÅÁï™ UPCH-89217	\n#‰æ°Ê†º 3,132ÂÜÜÔºàÁ®éËæºÔºâ','ÏùºÎ≥∏ÏóêÏÑú Ïù∏Í∏∞ ÎåÄÎã®ÌïòÎã§ Ï†ïÎßê„Öã. Ïï®Î≤î Î∞úÎß§ Ï≤´ÎÇ† Ïò§Î¶¨ÏΩò Ï∞®Ìä∏ 1Îì±ÌïúÎìØ?','4.7/5',0,0,0),(100000000,'http://www.popeyes.co.kr/','2015-06-09 09:47:14','2015-06-09 09:47:14','[ÏùåÏãù/ÏöîÎ¶¨/Í±¥Í∞ï]--ÏùåÏãùÏ†ê Ìï†Ïù∏Ï†ïÎ≥¥','ÌååÌååÏù¥Ïä§','#related\nhttp://www.popeyes.co.kr/event/\nhttps://www.facebook.com/PopeyesKorea','',