mmunity, fundamentally different from a traditional destination social network. When you‚Äôre on a site using Disqus, you‚Äôre exploring a personal passion and in an optimal place to discover new ideas, new people and new stories that you couldn‚Äôt find anywhere else.\n\n#Comments_Count\nWith Disqus, publishers experience a more engaged audience that spends more time on site and consumes more content. They grow their audience by being part of a content discovery loop across the Disqus network. They can turn on a new revenue stream through native advertising. Comments no longer cost, they count.\n\n#People_Just_Want_to_Be_Heard\nToday, we represent, in our one billion monthly visitors and over 40 languages, a vital part of the way the world communicates. People no longer just want to read or share the story. They want to be in the story. Disqus will shape the future of online discussion by continually giving people better ways to participate in the communities, events and stories shaping their lives.','DISQUS Ïù¥Î¶ÑÏóêÏÑúÎèÑ Ïïå Ïàò ÏûàÎìØÏù¥ ÌÜ†Î°† (DIScuss/Debate), ÎπÑÎÇú (DISs), ÏßàÎ¨∏ (QUestion), Ïö∞Î¶¨Îì§ (US) ÏùÑ ÎèÑÏôÄÏ£ºÎäî ÏÑúÎπÑÏä§.\n\nÎ™áÍ∞ÄÏßÄ ÏïÑÏâ¨Ïö¥ Ï†êÎèÑ ÏûàÍ∏¥ÌïúÎç∞, ÏßÄÍ∏àÍπåÏßÄ ÎÇòÏò® ÎåìÍ∏Ä ÏúÑÏ†Ø ÏÑúÎπÑÏä§ Ï§ëÏóêÏÑúÎäî Îã®Ïó∞ ÏúºÎú∏Ïù¥ÎùºÍ≥† ÏÉùÍ∞ÅÌï®.','4.7/5',0,0,0),(100000000,'https://distill.pub/2016/augmented-rnns/','2017-09-14 02:34:03','2017-09-14 06:16:34','[IT/Programming]--Í∏∞Í≥ÑÌïôÏäµ;[IT/Programming]--Í∏∞Í≥ÑÌïôÏäµ--RNN','Distill.pub - Attention and Augmented Recurrent Neural Networks','','',NULL,0,0,0),(100000000,'https://docs.mongodb.com/manual/tutorial/install-mongodb-on-os-x/','2017-07-20 04:42:30','2017-07-21 02:12:26','[IT/Programming]--Skelter Labs--Software Engineer Tutorial','https://docs.mongodb.com/manual/tutorial/install-mongodb-on-os-x/','#related\nhttps://cloud.mongodb.com/v2/597036f996e821293346f7d3#clusters\nhttps://docs.mongodb.com/manual/tutorial/getting-started/#getting-started','Getting started Î∂ÄÎ∂ÑÏùò Document