--
-- Table structure for table `users`
--

DROP TABLE IF EXISTS `users`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `users` (
  `i` bigint(20) NOT NULL DEFAULT '0',
  `id` char(21) NOT NULL,
  `email` varchar(50) NOT NULL,
  `pwd_salt` binary(128) NOT NULL,
  `pwd` binary(64) NOT NULL,
  `pwd_iteration` int(11) NOT NULL DEFAULT '10000',
  `veriKey` varchar(64) DEFAULT NULL,
  `ipReg` varchar(32) NOT NULL,
  `tReg` datetime NOT NULL,
  `tLastVisit` datetime NOT NULL,
  `rmbdC` int(11) DEFAULT '0',
  `ssnC` int(11) DEFAULT '0',
  `class` int(11) NOT NULL DEFAULT '0',
  `profile` varchar(1500) DEFAULT NULL,
  `settings` text,
  `lang` char(3) DEFAULT NULL,
  `fin` bigint(20) NOT NULL DEFAULT '0',
  PRIMARY KEY (`i`),
  UNIQUE KEY `id` (`id`),
  UNIQUE KEY `email` (`email`),
  KEY `class` (`class`),
  CONSTRAINT `users_ibfk_1` FOREIGN KEY (`class`) REFERENCES `userclass` (`class`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
